import React, { Component } from "react";

class HeaderRight extends Component {
  render() {
    return (
      <>
        <div className="col header-right">
          <ul className="nav justify-content-end">
            <li className="nav-item">
              <button className="btn shadow-none avatar rounded-circle p-0">
                <img
                  src="https://images-wixmp-ed30a86b8c4ca887773594c2.wixmp.com/f/d18257ed-4e57-4286-8a9a-a49a3b93e279/dbyfs5p-7e980a4e-f75e-4dae-baa0-df92fad00a02.png?token=eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9..ntTZhcqRWsVbLzXTyQJtOAWQSPqe_-RW7FRLCDKbHoY"
                  alt=""
                />
              </button>
            </li>
          </ul>
        </div>
      </>
    );
  }
}

export default HeaderRight;
